#initalize the Gui
Add-Type -AssemblyName System.Windows.Forms
[System.Windows.Forms.Application]::EnableVisualStyles()

#create the form
$Dgme = New-Object System.Windows.Forms.Form
$ButtonObject = [System.Windows.Forms.Button]

$dgme.BackColor = lightblue
#Size, Titel, and color of program
$Dgme.ClientSize = '1000,700'
$Dgme.text = "Des' Game - By: Matt :^  (make me full screen)"
$dgme.BackColor = "lightblue"


#box to explain what this is
$ruletxt                         = New-Object system.Windows.Forms.Label
$ruletxt.multiline               = $false
$ruletxt.width                   = 262
$ruletxt.height                  = 20
$ruletxt.location                = New-Object System.Drawing.Point(500,200)
$ruletxt.Font                    = New-Object System.Drawing.Font('Microsoft Sans Serif',20)
$ruletxt.Text                    = "Guess How Much I Miss You!"
$ruletxt.ForeColor               = “DarkBlue”
$ruletxt.AutoSize                = $true
$ruletxt.ReadOnly                = $true

#button option #1
$Button1                         = New-Object system.Windows.Forms.Button
$Button1.text                    = "None at all."
$Button1.width                   = 100
$Button1.height                  = 50
$Button1.location                = New-Object System.Drawing.Point(500,300)
$Button1.Font                    = New-Object System.Drawing.Font('Microsoft Sans Serif',10)
$Button1.BackColor               = ”Red”

#button option #2
$Button2                         = New-Object system.Windows.Forms.Button
$Button2.text                    = "Very, Very Much!"
$Button2.width                   = 100
$Button2.height                  = 50
$Button2.location                = New-Object System.Drawing.Point(770,300)
$Button2.Font                    = New-Object System.Drawing.Font('Microsoft Sans Serif',10)
$Button2.BackColor               = ”Green”


$pictureBox_logo = new-object Windows.Forms.PictureBox
$pictureBox_logo.Location = New-Object System.Drawing.Size(0,0)
$pictureBox_logo.Size = New-Object System.Drawing.Size(500,320)
$pictureBox_logo.Image =  [System.Convert]::FromBase64String('')
$pictureBox_logo.SizeMode = [System.Windows.Forms.PictureBoxSizeMode]::Zoom
$dgme.controls.add($pictureBox_logo)


$Button1.Enabled = $true
$Button2.Enabled = $true

$Dgme.controls.AddRange(@($ruletxt,$intxt,$outtxt,$imagepb,$Button1,$Button2,$Icon)) 

#### Logic Begin ###

$right = $Button2
$wrong = $Button1

